import React, { useState, useEffect } from 'react';
import './style.css';
import Comment from './components/Comment';
import Destinsation from './components/Destinations';
import Slide from './components/Slide';

function App() {
  const [comments, setComments] = useState([]);
  const [commentText, setCommentText] = useState('');
  const [commenterName, setCommenterName] = useState('');
  const [blogId, setBlogId] = useState('');

  // Function to open links
  const openLink = (url) => {
    window.open(url, "_blank");
  };

  // Fetch comments on component mount
  useEffect(() => {
    if (blogId) {
      getComments(blogId);
    }
  }, [blogId]);

  // Fetch content (HTML + CSS) dynamically
  const fetchContent = (contentUrl, cssFile) => {
    fetch(contentUrl)
      .then(response => response.text())
      .then(htmlContent => {
        let newWindow = window.open("", "_blank");
        newWindow.document.write(htmlContent);
        let linkElement = newWindow.document.createElement('link');
        linkElement.rel = 'stylesheet';
        linkElement.type = 'text/css';
        linkElement.href = cssFile;
        newWindow.document.head.appendChild(linkElement);
      })
      .catch(error => console.error('Error fetching document:', error));
  };

  // Comment submission
  const addComment = () => {
    if (!commentText || !commenterName) {
      alert("Please fill out both fields.");
      return;
    }

    fetch("/add_comment", {
      method: "POST",
      headers: {
        "Content-Type": "application/json"
      },
      body: JSON.stringify({
        blog_id: blogId,
        commenter_name: commenterName,
        comment_text: commentText
      })
    })
      .then(response => {
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        return response.json();
      })
      .then(data => {
        console.log(data.message);
        setCommentText('');
        setCommenterName('');
      })
      .catch(error => {
        console.error("There was a problem with your fetch operation:", error);
      });
  };

  // Fetch comments for a specific blog
  const getComments = (blog_id) => {
    fetch(`/get_comments/${blog_id}`)
      .then(response => {
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        return response.json();
      })
      .then(data => {
        setComments(data);
      })
      .catch(error => {
        console.error("There was a problem with your fetch operation:", error);
      });
  };

  return (
    <div className="App">
      <div className="top-bar">
        <div className="h">
          <h1>We`blog</h1>
        </div>
        <div id="input3">
          <button type="button" onClick={() => openLink('/register')}>Register</button>
          <button type="button" onClick={() => openLink('/login')}>Log in</button>
        </div>
      </div>
       
      <div id="Tab-bar">
        <div className="Search1">
          <section className="search-button">
            <input type="text" id="input" placeholder="Search..." />
            <button type="button"><i className="fa fa-search"></i></button>
          </section>
        </div>

        <div className="mainbuttons">
          <button className="b1" type="button" onClick={() => openLink('/')}>Home</button>
          <button className="b1" type="button" onClick={() => openLink('/about')}>About</button>
          <button className="b1" type="button">Travel</button>
          <button className="b1" type="button">Relax</button>
          <button className="b1" type="button">Eat</button>
        </div>

        <div className="fa">
          <button className="b2" type="button" onClick={() => openLink('https://www.instagram.com/')}><i className="fa fa-instagram"></i></button>
          <button className="b2" type="button" onClick={() => openLink('https://www.pinterest.com/')}><i className="fa fa-pinterest"></i></button>
          <button className="b2" type="button" onClick={() => openLink('https://www.facebook.com/')}><i className="fa fa-facebook"></i></button>
          <button className="b2" type="button" onClick={() => openLink('https://twitter.com/')}><i className="fa fa-twitter"></i></button>
        </div>
      </div>

      <div className="imgcontainer">
        <img src="images/Denmark-GettyImages-587892190.webp" alt="Denmark Travel" className="FrontImg1" />
        <div className="imgcontent">
          <h2>Travel Blogs</h2>
        </div>
      </div>

      <div className="ct">
        <p> terrace bar beckons you to indulge in an evening of refined relaxation and exquisite enjoyment...</p>
      </div>

      <Slide />

      <div className="qt">
        <h1 className="ch0"> As Featured in</h1>
        <h4 className="ch2">Travel blog</h4>
        <h4 className="ch3">Plane tour</h4>
        <h4 className="ch4">World travel</h4>
        <h4 className="ch5">skycloud</h4>
        <h4 className="ch6">Personal Blogs</h4>
      </div>

      <div className="Arena">
        <div className="line-above"></div>
        <div className="ted">Destination Guides</div>
        <div className="line-below"></div>
      </div>

      <Destinsation />

      <div className="Arena2">
        <div className="line-above"></div>
        <div className="ted">Explore</div>
        <div className="line-below"></div>
      </div>

      <div className="main-ct">
        <div className="mc">
            <h2>Explore the World with Us</h2>
            <p>Welcome to our travel platform, where your next adventure begins...</p>
        </div>

        <div className="fd">
          <div className="d">
            <img src="images/Morgan Maassen_Touch - 1.webp" alt="Wellness & Spas" />
            <h3>Wellness & Spas</h3>
            <p>The meaning of wellness travel...</p>
          </div>

          <div className="d">
            <img src="images/Singapore_shawnanggg--S15r4VsQhY-unsplash.webp" alt="Fifth Freedom Flights" />
            <h3>Fifth Freedom Flights</h3>
            <p>How to use fifth freedom flight routes...</p>
          </div>

          <div className="d">
            <img src="images/Del-Mar_2018_Del-Mar-Veranda-.webp" alt="Best Restaurants in Washington, DC" />
            <h3>20 Best Restaurants in Washington, DC</h3>
